import React from 'react';

import './css/style.css';

import NavBar from './components/navbar';
import Home from './components/home';

export default class App extends React.Component {
    render() {
        return <div className="App">
           <NavBar title={"NavBar"}/>
           <Home/>
        </div>
    }
}
